import React from 'react';
import { Image, Grid, Header, Icon, Container, Divider } from 'semantic-ui-react';
import cover from '../static/cover.png';
import NavigationBar from './Sidebar.jsx';
import Home from './Home.jsx';
import '../App.css';

class Wrapper extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      container: 'route1'
    };
  };

  render() {
    return(
        <Grid>
          <Grid.Row>
            <Grid.Column width={1}>
              <NavigationBar />
            </Grid.Column>
            <Grid.Column width={15}>
              <Home />
            </Grid.Column>
          </Grid.Row>
          <Grid.Row>
          </Grid.Row>
        </Grid>
  )};
};

export default Wrapper;
